document.getElementById("loginForm").addEventListener("submit", function(e) {
    e.preventDefault();
    var pw = document.getElementById("pw").value;
    if (!pw) return;
    document.getElementById("error").style.display = "none";
    document.getElementById("loading").style.display = "block";
    setTimeout(function() {
        try {
            var raw = CryptoJS.enc.Base64.parse(ENCRYPTED_DATA);
            var rawBytes = [];
            for (var i = 0; i < raw.sigBytes; i++) {
                rawBytes.push((raw.words[i >>> 2] >>> (24 - (i % 4) * 8)) & 0xff);
            }
            var salt = CryptoJS.lib.WordArray.create(new Uint8Array(rawBytes.slice(0, 16)));
            var iv = CryptoJS.lib.WordArray.create(new Uint8Array(rawBytes.slice(16, 32)));
            var ct = CryptoJS.lib.WordArray.create(new Uint8Array(rawBytes.slice(32)));
            var key = CryptoJS.PBKDF2(pw, salt, { keySize: 256/32, iterations: 100000, hasher: CryptoJS.algo.SHA256 });
            var decrypted = CryptoJS.AES.decrypt({ ciphertext: ct }, key, { iv: iv, mode: CryptoJS.mode.CBC, padding: CryptoJS.pad.Pkcs7 });
            var result = decrypted.toString(CryptoJS.enc.Utf8);
            if (result && result.length > 100 && result.indexOf("<!DOCTYPE") !== -1) {
                document.open();
                document.write(result);
                document.close();
            } else {
                document.getElementById("loading").style.display = "none";
                document.getElementById("error").style.display = "block";
                document.getElementById("pw").value = "";
            }
        } catch(err) {
            console.error("Decryption error:", err);
            document.getElementById("loading").style.display = "none";
            document.getElementById("error").style.display = "block";
            document.getElementById("pw").value = "";
        }
    }, 100);
});
</script>
